        "name": "Citadel Elite",
        "description": "<script type=\"text\/javascript\">\nvar header_ttips = new Object;\nheader_ttips['leonov_shop_standard']  = '';\nheader_ttips['leonov_shop_homemaps']  = '';\n<\/script>\n\n<table id=\"shipDetails\">\n    \u00a1Esta fortaleza volante les ense\u00f1ar\u00e1 a tus enemigos lo que es el miedo de verdad! Esta nave tiene las habilidades siguientes: 5% m\u00e1s de da\u00f1os, las habilidades \"Escudo protector\" y \"Atracci\u00f3n de fuego\" duran un 50% m\u00e1s; \"Fortaleza\", un 25% menos; y \"Rayo veloz\", un 15% menos.<br \/><br \/>\n\n    <tr id=\"\" class=\"odd\">\n        <td class=\"label\"><\/td>\n        <td id=\"firstColumn_leonov\" class=\"firstColumn\">\n            \n            \n                <script type='text\/javascript'>\n                    jQuery(\"#firstColumn_leonov\").qtip({\n                        content: header_ttips.leonov_shop_standard,\n                        style:'dohdr',\n                        position:{target:'mouse'}\n                    });\n                <\/script>\n            \n        <\/td>\n        <td id=\"secondColumn_leonov\" class=\"secondColumn\">\n\t        \n            \n                <script type='text\/javascript'>\n                    jQuery(\"#secondColumn_leonov\").qtip({\n                        content: header_ttips.leonov_shop_homemaps,\n                        style:'dohdr',\n                        position:{target:'mouse'}\n                    });\n                <\/script>\n            \n        <\/td>\n    <\/tr>\n        <div class=\"shipDescrSkill\">\n        <div class=\"shipDescriptionSkillHeadline\" style=\"background-image: url(https:\/\/darkorbit-22.bpsecure.com\/do_img\/global\/skills\/skill_icon_draw_fire_32x35.png?__cv=d68814d30de5592b467f15e1432bdd00);\">\n            <div class=\"shipDescriptionSkillHeadlineText\">Atracci\u00f3n de fuego<\/div>\n        <\/div>\n        <div class=\"shipDescriptionSkillText\">Con esta habilidad, desv\u00edas temporalmente el fuego de las naves enemigas que est\u00e1n a tu alrededor hacia ti mismo.<\/div>\n    <\/div>\n        <div class=\"shipDescrSkill\">\n        <div class=\"shipDescriptionSkillHeadline\" style=\"background-image: url(https:\/\/darkorbit-22.bpsecure.com\/do_img\/global\/skills\/skill_icon_travel_mode_32x35.png?__cv=6e378495edd9d9775a01e0c3a5a41900);\">\n            <div class=\"shipDescriptionSkillHeadlineText\">Rayo veloz<\/div>\n        <\/div>\n        <div class=\"shipDescriptionSkillText\">Esta habilidad aumenta durante un corto periodo de tiempo tu velocidad. As\u00ed podr\u00e1s acortar las distancias.<\/div>\n    <\/div>\n        <div class=\"shipDescrSkill\">\n        <div class=\"shipDescriptionSkillHeadline\" style=\"background-image: url(https:\/\/darkorbit-22.bpsecure.com\/do_img\/global\/skills\/skill_icon_protect_32x35.png?__cv=038d8d948c1e31a5e423ad6396d77b00);\">\n            <div class=\"shipDescriptionSkillHeadlineText\">Escudo protector<\/div>\n        <\/div>\n        <div class=\"shipDescriptionSkillText\">Al usar esta habilidad, se desplega un escudo protector alrededor de tu nave. Este desv\u00eda hacia ti una parte de los da\u00f1os de todos los miembros de tu grupo en las inmediaciones.<\/div>\n    <\/div>\n        <div class=\"shipDescrSkill\">\n        <div class=\"shipDescriptionSkillHeadline\" style=\"background-image: url(https:\/\/darkorbit-22.bpsecure.com\/do_img\/global\/skills\/skill_icon_fortify_32x35.png?__cv=1e5df504b5ad98e2e842e8b5c58f5500);\">\n            <div class=\"shipDescriptionSkillHeadlineText\">Fortaleza<\/div>\n        <\/div>\n        <div class=\"shipDescriptionSkillText\">Esta habilidad proporciona un blindaje protector a tu nave y reduce los da\u00f1os que recibes. Sin embargo, durante ese tiempo no podr\u00e1s moverte.<\/div>\n    <\/div>\n    \n<br \/>\n\n    <tr id=\"speed\" class=\"even\">\n        <td class=\"label\">Velocidad<\/td>\n        <td class=\"firstColumn\">\n        \t240\n        <\/td>\n            <\/tr>\n    <tr id=\"load\" class=\"odd\">\n        <td class=\"label\">Carga<\/td>\n        <td class=\"firstColumn\">\n        \t4.000\n        <\/td>\n            <\/tr>\n    <tr id=\"laser\" class=\"even\">\n        <td class=\"label\">L\u00e1ser<\/td>\n        <td class=\"firstColumn\">\n        \t7\n        <\/td>\n            <\/tr>\n    <tr id=\"generatoren\" class=\"odd\">\n        <td class=\"label\">Generadores<\/td>\n        <td class=\"firstColumn\">\n        \t20\n        <\/td>\n            <\/tr>\n    <tr id=\"hitpoints\" class=\"even\">\n        <td class=\"label\">Puntos de vida<\/td>\n        <td class=\"firstColumn\">\n        \t650.000\n        <\/td>\n            <\/tr>\n    <tr id=\"specials\" class=\"odd\">\n        <td class=\"label\">Extras<\/td>\n        <td class=\"firstColumn\">\n        \t5\n        <\/td>\n            <\/tr>\n    <tr id=\"upgradeModules\" class=\"even\">\n        <td class=\"label\">M\u00f3dulos de mejora de naves<\/td>\n        <td class=\"firstColumn\">\n        \t3\n        <\/td>\n            <\/tr>\n\n<\/table>\n",
